import{useState} from 'react'
const questions = [ 
    {
        id: 1,
        word: "slowly",
        pos: "adverb"
    },
    {
        id: 2,
        word: "ride",
        pos: "verb"
    },
    {
        id: 3,
        word: "bus",
        pos: "noun"
    }
]
const Question = () => {
    const [questions, setQuestions] = useState([ 
        {
            id: 1,
            word: "slowly",
            pos: "adverb"
        },
        {
            id: 2,
            word: "ride",
            pos: "verb"
        },
        {
            id: 3,
            word: "bus",
            pos: "noun"
        }
    ])
  return (
    <>
      {questions.map((ques)=>(
        <h3 key={ques.id}>{ques.word}</h3>
      ))}
    </>
  )
}

export default Question
